import React from "react";

export const HomePage = () => {
  return (
    <div>
      <div className="w-full bg-oracle ">
        <div className="container mx-auto">
          <div
            className={
              "w-full  py-5 px-3 flex flex-row justify-between items-center"
            }
          >
            <a className="font-bold text-3xl tracking-wider	text-nero">
              Vigeesh Kumar
            </a>
            <nav className="relative w-full py-4  navbar navbar-expand-lg navbar-light">
              <ul>
                <li>
                  <a>Home</a>
                </li>
              </ul>
            </nav>
          </div>
          <h1 className="text-3xl font-bold underline">Hello</h1>
        </div>
      </div>
    </div>
  );
};
